UPDATE `page_text` SET `text`='$N,

The Cipher of Damnation is indeed a powerful incantation. Ancient and chaotic, the cipher itself has been responsible for many tragedies in the history of our worlds. That is to say, it is not unique to Draenor.$B$BThe burning symbol you saw was the mark of Kael\'Thas. His knowledge of the ancient words explains much.$B$BYour discovery has roused the naaru. A\'dal has requested your presence in Shattrath City. Should you choose to come, seek me out at the Terrace of Light.

Humbly Yours,

Khadgar
' WHERE `entry`=2998;

UPDATE `npc_text` SET `em0_0`=0,`em0_1`=1 WHERE `ID`=538;
UPDATE `npc_text` SET `text0_0`='Naralex sleeps again!$b$bLong ago, Naralex journeyed to this cavern with the honorable goal of entering the Emerald Dream and regrowing the Barrens into a lush forest. His focus waned and his thoughts became tainted by serpentine visions.$b$bNow, reptilian beasts seep from his dreams to the land. He must be awoken from the nightmare or he will be forever lost, and a great evil unleashed.$b$bOnly after his corrupted servants, the Fanglords, have been slain can I perform the awakening ritual.$B$B',`em0_0`=0,`em0_2`=0,`em0_3`=1,`em0_5`=1 WHERE `ID`=698;
